import './App.css';

import ImageFadeIn from "react-image-fade-in";
import { NaviBarComponent } from './components/NavigationBar';
import Typewriter from "typewriter-effect";
import ParticlesComponent from './components/Particles';
import { FooterBar } from './components/FooterBar';


function App() {
  return (
    <div className="App">
      <NaviBarComponent />
      <header className="App-header">
        <ImageFadeIn opacityTransition='5' src='https://raw.githubusercontent.com/dhaliwalg/dhaliwalg.github.io/master/site/profpic.jpg' className="App-logo" alt="logo" />
      </header>

      <ParticlesComponent className='particles' />

      <div className='typer'>
        <Typewriter onInit={(typewriter) => {
          typewriter

            .typeString("hi i'm gurjit")
            .pauseFor(4000)
            .typeString(" ਗੁਰਜੀਤ")
            .pauseFor(3000)
            .deleteAll()
            .typeString("striving to set an example for sikh youth")
            .pauseFor(3000)
            .deleteAll()
            .start();
        }}
        />
      </div>

    <FooterBar className="App-logo-spin"/>
    </div>
  );
}

export default App;
